import React from "react";
import {
  FaLinkedin,
  FaGithub,
  FaEnvelope,
  FaCloudDownloadAlt,
} from "react-icons/fa";

const ContactSideBar = () => {
  return (
    <div style={{ borderColor: "black", display: "flex" }} className="sidebar">
      <a
        href="linkedin.com/in/lola-kasimova-9533a794"
        target="_blank"
        rel="noopener noreferrer"
        style={{ marginRight: "20px" }}
      >
        <FaLinkedin
          size={40}
          style={{
            color: "blue",
          }}
        />
      </a>
      <a
        href="https://github.com/19Lola89"
        target="_blank"
        rel="noopener noreferrer"
        style={{ marginRight: "20px" }}
      >
        <FaGithub size={40} style={{ color: "black" }} />
      </a>
      <a className="envelope-logo" href="mailto:lolakasimova@icloud.com">
        <FaEnvelope size={40} style={{ color: "green" }} />
      </a>

      <a href="/path/to/file" style={{ marginRight: "20px" }} download>
        <FaCloudDownloadAlt
          size={40}
          style={{ color: "pink", marginRight: "20px" }}
        />
      </a>
    </div>
  );
};

export default ContactSideBar;
